FAQ : Pourquoi les colonnes n'apparaissent pas sur le fichier proposé ?
Pour permettre l'utilisation d'automates, la structure du fichier s'affiche en format XSD. Pour retrouver les colonnes d'un format type tableur, il faut vous référer à la description du fichier disponible en format PDF.

Ce jeu de données contient toutes les données statistiques disponibles informatiquement sur les interventions d’assistance et de sauvetage coordonnées par les CROSS (Centres régionaux opérationnels de surveillance et de sauvetage). Il renseigne, pour chaque opération d’assistance ou de secours coordonnée en eaux françaises :

- quel était le motif d’intervention ;
- quand, comment et par qui l’alerte a été donnée ;
- le contexte météo et géographique de l’opération ;
- quels flotteurs étaient impliqués ;
- quels moyens aériens, nautiques ou terrestres ont été engagés ;
- quel a été le bilan humain de l’opération.

Ce jeu de données contient des données propres à un métier complexe et chaque fichier comporte plusieurs centaines de milliers de lignes. Nous vous recommandons de lire attentivement [la documentation](https://mtes-mct.github.io/secmar-documentation/) mise à votre disposition avant toute analyse.

La publication des moyens engagés pour chaque opération (fichier `moyens.csv`) sera réalisée ultérieurement.

Ce jeu de données est produit par la Direction des Affaires Maritimes.

### Mise à jour
L'actualisation des données est quotidienne et comprend les données jusqu'à J-1.

Cette base de données contient l'ensemble des remboursements mensuels effectués par le régime général de l'Assurance Maladie (hors prestations hospitalières) par type de prestations (soins et prestations en espèces), type d'exécutant (médecins par spécialité, chirurgiens dentistes, auxiliaires médicaux, laboratoires d'analyse, pharmaciens, ...) et par type de prescripteurs. Les dépenses sont indiquées en montants remboursés et présentées au remboursement.


Concernant les dépenses de santé d'assurance maladie, trois autres jeux de données, couvrant des champs différents, sont proposés :
- [Dépenses d'assurance maladie hors prestations hospitalières par caisse primaire/département](https://www.data.gouv.fr/fr/datasets/depenses-d-assurance-maladie-hors-prestations-hospitalieres-par-caisse-primaire-departement/) : base de données regroupant l'ensemble des remboursements (hors prestations hospitalières) effectués par le régime général de l'Assurance Maladie en France ;

- [Dépenses annuelles d'assurance maladie](https://www.data.gouv.fr/fr/datasets/depenses-annuelles-d-assurance-maladie/) : tableaux de bord portant sur l'ensemble des remboursements (y compris les prestations hospitalières) effectués par le régime général de l'Assurance Maladie en France métropolitaine ;

- [Open Damir : base complète sur les dépenses d'assurance maladie inter régimes](https://www.data.gouv.fr/fr/datasets/open-damir-base-complete-sur-les-depenses-dassurance-maladie-inter-regimes/) : base de données regroupant l'ensemble des remboursements (y compris prestations hospitalières facturées directement à l'Assurance Maladie) effectués par tous les régimes d'assurance maladie en France.

