Laboratories and research centers in Austria, France, Germany, Italy, Liechtenstein, Slovenia, and Switzerland. 

The dataset has been created in the Re-search ALPS Action (INEA CEF-TELECOM Project - funded by European Union, AGREEMENT No INEA/CEF/ICT/A2016/1296967) which aims to gather, consolidate, harmonise and make available to different target groups (public and private bodies) data about laboratories and research and innovation centers active in the seven countries that constitute the Alpine Area.

The action will support the research and development process by providing harmonised information on:
- what the laboratories and research centers do;
- where they are located;
- where excellence emerges, according to research fields/themes and numbers (e.g., number of active researchers, number of published papers, number of prizes, number of ongoing EU projects, number of patents);
- key people working in a specific center;
- network of relations they highlight in their websites.

Cette base de données contient l'ensemble des remboursements mensuels effectués par le régime général de l'Assurance Maladie (hors prestations hospitalières) **par caisse primaire/département**, par type de prestations (soins et prestations en espèces), type d'exécutant (médecins par spécialité, chirurgiens dentistes, auxiliaires médicaux, laboratoires d'analyse, pharmaciens, ...) et par type de prescripteurs. Les dépenses sont indiquées en montants remboursés et présentées au remboursement.

Les tables mensuelles au format csv sont regroupées dans des fichiers zip annuels. Deux présentations sont disponibles : une version complète avec les libellés des variables et des regroupements pour certaines variables et une version simplifiée, sans les libellés et sans les regroupements. Les utilisateurs des tables simplifiées pourront se rapporter au lexique de la nomenclature. 

Concernant les dépenses de santé d'assurance maladie, trois autres jeux de données, couvrant des champs différents, sont proposés :

- [Dépenses d'assurance maladie hors prestations hospitalières (données nationales)](https://www.data.gouv.fr/fr/datasets/depenses-d-assurance-maladie-hors-prestations-hospitalieres-donnees-nationales/) : base de données regroupant l'ensemble des remboursements (hors prestations hospitalières) effectués par le régime général de l'Assurance Maladie en France ;

- [Dépenses annuelles d'assurance maladie ](https://www.data.gouv.fr/fr/datasets/depenses-annuelles-d-assurance-maladie/): tableaux de bord portant sur l'ensemble des remboursements (y compris les prestations hospitalières) effectués par le régime général de l'Assurance Maladie en France métropolitaine ;

- [Open Damir : base complète sur les dépenses d'assurance maladie inter régimes](https://www.data.gouv.fr/fr/datasets/open-damir-base-complete-sur-les-depenses-dassurance-maladie-inter-regimes/) : base de données regroupant l'ensemble des remboursements (y compris prestations hospitalières facturées directement à l'Assurance Maladie) effectués par tous les régimes d'assurance maladie en France.
